                        <span class="visually-hidden">Toggle Dropdown</span>
                    </button>
                    <ul class="dropdown-menu">
                        @foreach ($month as $item)
                            <li><a class="dropdown-item" onclick="(changText({{$item}}))">
                                @if ($item)
                                    {{$item}}
                            </a></li>
                            @else
                                전체
                            @endif
                        @endforeach
                    </ul>
                </div>
            </div>
